import { useEffect } from 'react';
import { getRedirectResult } from 'firebase/auth';
import { auth, signInWithGooglePopup, createNeo4jUser ,signInWithGoogleRedirect } from '../../utils/firebase/firebase.utils';

const SignIn = () => {

    const logGoogleUser = async () => {
        try {
           const {user }=  await signInWithGooglePopup();
              console.log(user);
            const userNoderef =  await createNeo4jUser(user);
            console.log(userNoderef);
        } catch (error) {
            console.log(error);
        }
    }

    useEffect( async () => {
        const handleRedirectResult = async () => {
            try {
                const result = await getRedirectResult(auth);
                if (result.user) {
                    console.log(result.user);
                    const userNoderef = await createNeo4jUser(result.user);
                    console.log(userNoderef);
                }
            } catch (error) {
                console.log(error);
            }
        } 
        handleRedirectResult();
    }, []);


    return(
        <div>
            <h1>Sign In</h1>
            <button onClick={logGoogleUser}>Sign In with Google</button>
            <button onClick={signInWithGoogleRedirect}>Sign In with Google Redirect</button>
        </div>
    )
};

export default SignIn;
